        imagesc(introscreen),axis off,colormap([0.9 0.9 0.8;0.3 0.5 0;0 0.3 0.5])
        hold on,plot(pos(selection(1),1),pos(selection(1),2),'pentagram',...
            'MarkerFaceColor',[0 0.3 0.5],'MarkerEdgeColor',[0.3 0.5 0],...
