        pause(items.delay)
    end
    items.guy=selection(1);
end
function introlisten(a,b)
    switch b.Key
        case 'return'
            start=1;
        case 'downarrow'
            selection=circshift(selection,[0 -1]);
        case 'uparrow'
            selection=circshift(selection,[0 1]);
    end
end
function setupbadguys
badguy.s=3:items.nummobs;
    badguy.init=badguy.s;
    badguy.type=randi(6,1,numel(badguy.s));
    badguy.shoes=badguyguys(2,badguy.type);
    badguy.moves=badguy.shoes;
    badguy.dudes=[pcguys(1,items.guy) 2 badguyguys(1,badguy.type)];
% dr.mario blue/red 1 3, exit 2 fairy 4 sleeper 5 metroid 6 mog 7 tata 8
% Lagomorph 9 black guard 10
end
for level=1:15
items.size=max(7,ceil(level/2)+4);   
items.exit=false;
items.auto=0;
items.level=level;
items.nummobs=5;
items.alive=true(1,items.nummobs);
setupbadguys

items.guymoves=items.shoes;
items = dungeons(items,badguy);
if items.q
    clc
    return
end
end
clc
disp('Thank you for playing!')
end

function items = dungeons(items,badguy)
way = 1;
walls = []; ghostwalls = []; num = []; room = []; r = [];exppoints = [];
ways = [-items.size;-1;items.size;1];
s = sprites;
cmap = definecmap;

function setuppatrolpath  
    for k=badguy.s
        path=walls(num(k),:);
        if sum(path([1 3]))==0
            path=[1 3];
            path=path(randperm(2));
            wayforward=path(1);
            wayback=path(2);
        elseif sum(path([2 4]))==0
            path=[2 4];
            path=path(randperm(2));
            wayforward=path(1);
            wayback=path(2);
        else
            path=find(path==0);
            path=path(randperm(numel(path)));
            if ~isempty(path)
            wayback=[3 4 1 2];
            wayforward=path(1);
            wayback=wayback(path(1));
            else
                wayforward=1;
                wayback=1;
            end
        end
        badguy.patrol(k,:)=[wayforward wayback];
    end
end
function cmap = definecmap
cmap=[0.9 0.9 0.8;... % floor
      0   0   0  ;... % black
      1   0.7 0  ;... % yellow
      0   0.3 0.9;... % blue
      0.9 0.1 0.1;... % red
      0.2 0.4 0  ;... %green
      0.1 0.25 0  ];  % walls
end
function guypositions
    num = randperm(items.size*items.size)';
    num = num(1:items.nummobs);
    items.numinit=num;      
end
function buildwalls
    while way
    r=randi(5,items.size,items.size);
    rshift=circshift(r,[0 1]);
    walls=(r(:)==1)+(rshift(:)==3)>0;walls(1:items.size,1)=1;
    ghostwalls=(r(:)==1)+(rshift(:)==3)==0;ghostwalls(1:items.size,1)=1;
    rshift=circshift(r,[1 0]);
    walls(:,2)=(r(:)==2)+(rshift(:)==4)>0;walls(1:items.size:end,2)=1;
    ghostwalls(:,2)=(r(:)==2)+(rshift(:)==4)==0;ghostwalls(1:items.size:end,2)=1;
    rshift=circshift(r,[0 -1]);
    walls(:,3)=(r(:)==3)+(rshift(:)==1)>0;walls(end-items.size+1:end,3)=1;
    ghostwalls(:,3)=(r(:)==3)+(rshift(:)==1)==0;ghostwalls(end-items.size+1:end,3)=1;
    rshift=circshift(r,[-1 0]);
    walls(:,4)=(r(:)==4)+(rshift(:)==2)>0;walls(items.size:items.size:end,4)=1;
    ghostwalls(:,4)=(r(:)==4)+(rshift(:)==2)==0;ghostwalls(items.size:items.size:end,4)=1;
    
    template=[ones(27,1) zeros(27,26)];
    rshift(:)=walls(:,1);
    room=forchuck(rshift,27).*repmat(template,items.size,items.size);
    rshift(:)=walls(:,2);
    room=room+forchuck(rshift,27).*repmat(template',items.size,items.size);
    rshift(:)=walls(:,3);
    room=room+forchuck(rshift,27).*repmat(template(:,end:-1:1),items.size,items.size);
    rshift(:)=walls(:,4);
    room=(room+forchuck(rshift,27).*repmat(template(:,end:-1:1)',items.size,items.size))>0;
    
    way=zeros(size(room));
    way(s2i(room,27*i2s(r,num(1))-13))=1;
    pc=way;
    way=zeros(size(room));
    way(s2i(room,27*i2s(r,num(2))-13))=1;
    stairs=way;
    way=zeros(size(room));
    way(s2i(room,27*i2s(r,num(3))-13))=1;
    way= imreconstruct(pc,double(room==0))...
        .*imreconstruct(way,double(room==0))...
        .*imreconstruct(stairs,double(room==0));
    way=sum(way(:))==0;
    end
end
function gameboard
set(gcf,...
            'KeyPressFcn',@listener, ...
            'Name',['Level ',num2str(items.level)], ...
            'Position',[200 150 600 500], ...
            'Resize','off', ...
            'NumberTitle','off', ...
            'IntegerHandle','off', ...
            'MenuBar', 'none', ...
            'Tag','Look',...
            'Interruptible', 'on', ...
            'WindowStyle', 'normal', ...
            'DockControls', 'off', ...
            'Visible','on'); 
        
board = double(room);
board(board==1)=6;
for t=[badguy.s 2 1]
if items.alive(t)
coords=27*(i2s(r,num(t))-1)+2;
board(coords(1):coords(1)+23,coords(2):coords(2)+23)=s(badguy.dudes(t)).s(:,:,mod(ceil(8*toc/5),4)+1);
imagesc(board),axis off,colormap(cmap)
end
end
end
function listener(a,b)
switch b.Key
    case 'leftarrow'
        way=1;
    case 'uparrow'
        way=2;
    case 'rightarrow'
        way=3;
    case 'downarrow'
        way=4;
    case 'escape'
        items.exit=true;
        items.q=true;
    case 'r'
        num=items.numinit;
        badguy.s=badguy.init;
        items.guymoves=items.shoes;
        exppoints=0;
        tic
    case 'w'
        items.guymoves=items.guymoves-1;
        for k=badguy.s
            if badguy.type(k-2)==5
            patrol(k)
            end
        end
    case 'a'
        switch items.auto
            case 0
                disp('Auto-play')
                items.ap=indianajones(1,2);
                if items.ap~=0
                items.auto=1;
                else
                    disp('Path too complex for autoplay...')
                end
            otherwise
                items.auto=0;
        end
    otherwise
end

end
function moveguy
    [w,whichguy]=wallcheck(1);
    if ~w
        num(1)=num(1)+ways(way);
        sound( [[log(1:500) log(500)*ones(1,500) log(500:-1:1)]/log(500)].*sin( (1:1500)*pi/ (randi(4) + 10) ) )
        items.guymoves=items.guymoves-1;
        if whichguy==2
            items.exit=true;
            items.exppoints=items.exppoints+exppoints;
            clc
            disp(['Level ',num2str(items.level),' Complete!'])
        elseif whichguy>2
            battle
            items.guymoves=items.shoes;
            items.alive(whichguy)=false;
            num(whichguy)=-1;
        else
            for k=badguy.s
                if badguy.type(k-2)==5 && items.alive(k)
                patrol(k)
                end
            end
        end        
    else
        way=0;
    end
end
function patrol(k)            
    way = badguy.patrol(k,1);
    [w,whichguy] = wallcheck(k);
    if whichguy>1
        w=1;
    end
    if w
        badguy.patrol(k,:)=badguy.patrol(k,end:-1:1);
        way=0;
    end   
    if way
    num(k)=num(k)+ways(way);
    if whichguy==1
        battle
        items.guymoves=items.shoes;
        items.alive(k)=false;
        num(k)=-1;
    end
    end             
    way=0;
end
function movebadguys
    while sum(badguy.moves)
       for k=badguy.s 
            if badguy.moves(k-2) && items.alive(k)
                switch badguy.type(k-2)
                    case 1
                        wander
                    case 2
                        chase
                    case 3
                        ghosts
                    case 4
                        whichguy = block;
                    case 6
                        badchase
                end
                if way
                num(k)=num(k)+ways(way);
                if whichguy==1
                    battle
                    badguy.moves(:)=0;
                    items.alive(k)=false;
                    num(k)=-1;
                end
                end
                way=0;
            end
       end
       badguy.moves=max(0,badguy.moves-1);
       gameboard
       pause(12*items.delay)
    end
    badguy.moves=badguy.shoes;
    way=0;
    function wander
        w=1;
        count=4;
        while w
        way=randi(4);
        [w,whichguy]=wallcheck(k);
        count=count-1;
        if count<=0 && w
           way=0;
           w=0;
        elseif whichguy>1
            w=1;
        end
        end
    end
    function chase
        bpi=badguy.shoes(k-2)-badguy.moves(k-2)+1;
        if bpi==1
        badguy.bp{k} = indianajones(k,1);
        end
        bp=badguy.bp{k};
        way=bp(bpi);
        if way==0
           badguy.moves(k-2)=badguy.moves(k-2)-1;
           return
        end
        [w,whichguy]=wallcheck(k);
        if whichguy>1
           way=0;
        end
    end
    function ghosts
       wallsstore=randi(20);
       if wallsstore<5
           badchase
       else
       wallsstore=walls;
       walls=ghostwalls;
       w=1;
       count=4;
       while w
        way=randi(4);
        [w,whichguy]=wallcheck(k);
        count=count-1;
        if count<=0 && w
           way=0;
           w=0;
        elseif whichguy>1
            w=1;
        end
       end
       walls=wallsstore;
       end
    end
    function whichguy = block
        lookaround=sum(repmat(num(k),4,1)+ways==num(1));
        if lookaround
            badguy.moves(k-2)=0;
        else
        w=1;
        count=4;
        while w
            way=randi(4);
            [w,whichguy]=wallcheck(k);
            count=count-1;
            if count<=0 && w
               way=0;
               w=0;
            elseif whichguy>0
                w=1;
            end
        end
        end
        whichguy=0;
    end
    function badchase
        coords=i2s(r,num([1 k]));
        vector=coords(1,:)-coords(2,:);
        svec=(sign(vector)+[3 2]).*abs(sign(vector));
        svec(svec==0)=find(svec==0)+1;

        if abs(vector(1))==abs(vector(2))
            desire=[svec(randperm(numel(svec)))];
        elseif abs(vector(1))>abs(vector(2))
            desire=[svec];
        else
            desire=[svec(end:-1:1)];
        end
        for t=1:2
            way=desire(t);
            [w,whichguy]=wallcheck(k);
            if whichguy>1
               w=1; 
            end
            if ~w
                break
            else
                way=0;
            end
        end
    end
end
function [w,whichguy] = wallcheck(whichguy)
    w = walls(num(whichguy),way);
    whichguy=find(num(whichguy)+ways(way)==num);
end
function boulderpath = indianajones(from,to)
    numstore=num;
    wallsstore=walls;
    wayback=[3 4 1 2];
    if to~=2
        for t=1:4
       dex = num(2)+ways(wayback(t));
       if dex>0 && dex<numel(r)+1
       walls(dex,t)=1;
       end
        end
    end
    boulderroll=true;
    boulderpath=[];
    troom=double(room==0);
    count=1;
    while boulderroll
        if from>1
           count=badguy.shoes(from-2)+4;
           count=count-1;
        end
    boulderspot=num(from);
    for t=1:4
       dex = boulderspot+ways(wayback(t));
       if dex>0 && dex<numel(r)+1
       walls(dex,t)=1;
       end
    end
    coords=i2s(r,num([to from]));
    vector=coords(1,:)-coords(2,:);
    svec=(sign(vector)+[3 2]).*abs(sign(vector));
    svec(svec==0)=find(svec==0)+1;
    
    if abs(vector(1))==abs(vector(2))
        desire=[svec(randperm(numel(svec))) wayback(svec(randperm(numel(svec)))) 5];
    elseif abs(vector(1))>abs(vector(2))
        desire=[svec wayback(svec(end:-1:1)) 5];
    else
        desire=[svec(end:-1:1) wayback(svec) 5];
    end
    
    for kk=1:numel(desire)
        if desire(kk)==5
            boulderpath=0;
            boulderroll=false;
            break
        end
        
        way=desire(kk);
        [w,whichguy]=wallcheck(from);
        
        if from~=1
        if whichguy>1
            boulderpath=[boulderpath 0];
            boulderroll=false;
            break            
        end
        end
        if ~w
            if whichguy==to
                boulderpath=[boulderpath way];
                boulderroll=false;
                break
            elseif count==0
                boulderpath=[boulderpath way];
                boulderroll=false;
                break
            end
        end
        
        if ~w
        tnum=num([to from])+[0;1]*ways(way);
        boulder=27*i2s(r,boulderspot);
        troom(boulder(1)-26:boulder(1),boulder(2)-26:boulder(2))=0;
        z=zeros(size(room));
        z(s2i(room,27*i2s(r,tnum)-13))=1;
        z=bwlabel(imreconstruct(z,troom));
        m=max(z(:))-1;
            if ~m
                num(from)=num(from)+ways(way);
                boulderpath=[boulderpath way];
                break
            end
        end
    end
        
    end
    num=numstore;
    walls=wallsstore;
end
