function out = i2s(open,in)
siz = size(open);
siz = double(siz);
out(:,2) = floor((in-1)/siz(1))+1;
out(:,1) = in-(out(:,2)-1)*siz(1);
end
function out = s2i(open,in)
siz  = size(open);
out = in(:,1)+(in(:,2)-1)*siz(1);
end

function out = forchuck(in,sz)
for x=1:numel(in(:,1))
    for y=1:numel(in(1,:))
        out( (sz*x-sz+1):(sz*x),(sz*y-sz+1):(sz*y) )=in(x,y);
    end
end
